**Ответ:** 

1. **Распознавание численных значений:**  
   * **Массовая доля:**  Использую поиск ключевых слов, обозначающих проценты, например "массовая доля" "на %".
   * **Количество:** Использую поиск ключевых слов, обозначающих количественные показатели, например "кг", "т", "п/э", "мешки", "ван".
2. **Формирование JSON:**  
    * **JSON структура:**  Использую ключевые слова для структурирования JSON, например, "массовая доля" и "прочее" для соответствия с определенными категориями данных.
    * **Поиск и замена:**  Использую регулярные выражения, чтобы заменить ключевые слова в тексте на соответствующие JSON значения.  

3. **Примеры:**
  * **Массовая доля:**  "Массовая доля N 12%" ->  `{"вещество": "N", "массовая доля": 12}`.  
  * **Количество:** "1000 кг" ->  `{"масса": 1000, "единица": "кг"}`.  
  * **Прочие:** "в 500 мешках" ->  `{"параметр": "пакетирование", "значение": "500"}`

**Как вычисляете эти значения из текста?**  
