*  Затем я формирую JSON-объект, используя эти значения для соответствия с JSON структурой. 


**Важно:**  

* Текст содержит информацию о массе,  
* Регулярные выражения помогают найти ключевые слова.
* Я использую механизмы обработки текста для поиска и вывода численных значений.

