```python
import re

def extract_numerical_data(text):
  """
  Extracts numerical data (masses, ratios, units) from a given text.

  Args:
    text: The input text.

  Returns:
    A dictionary containing extracted data.
  """

  data = {}

  # Match mass percentages
  mass_percentages = re.findall(r"(\d+\.\d+)\% ([\w\s]+)", text)
  for percentage in mass_percentages:
    data[percentage[0]] = percentage[1]

  # Match other numerical values 
